import React, { useState } from "react";
import CurrentResult from "./components/CurrentResult";
import SearchHistory from "./components/SearchHistory";

function App() {
  const [tab, setTab] = useState("current");

  return (
    <div className="App">
      <div className="flex justify-center space-x-4 p-4 bg-gray-800 text-white">
        <button
          className={`px-4 py-2 ${tab === "current" ? "bg-blue-500" : "bg-gray-600"}`}
          onClick={() => setTab("current")}
        >
          Resultado Actual
        </button>
        <button
          className={`px-4 py-2 ${tab === "history" ? "bg-blue-500" : "bg-gray-600"}`}
          onClick={() => setTab("history")}
        >
          Historial
        </button>
      </div>

      {tab === "current" ? <CurrentResult /> : <SearchHistory />}
    </div>
  );
}

export default App;
